import React from 'react';
import TelegramIcon from '@material-ui/icons/Telegram';
import BatteryChargingFullIcon from '@material-ui/icons/BatteryChargingFull';
import LocalOfferIcon from '@material-ui/icons/LocalOffer';
import ListAltIcon from '@material-ui/icons/ListAlt';
import '../App.css';

const Icon = (props) => {
  console.log(props);
  return (
    <div className='icons-container'>
      <div className='icons'>
        <div>
          <LocalOfferIcon
            style={{
              border: '1px solid black',
              borderRadius: '50%',
              fontSize: '50px',
              padding: '6px',
            }}
          />
        </div>
        <div>
          <p>Price</p>
          <p>{props.price}</p>
        </div>
      </div>
      <div className='icons'>
        <div>
          <LocalOfferIcon
            style={{
              border: '1px solid black',
              borderRadius: '50%',
              fontSize: '50px',
              padding: '6px',
            }}
          />
        </div>
        <div>
          <p>Price</p>
          <p>55e</p>
        </div>
      </div>
      <div className='icons'>
        <div>
          <LocalOfferIcon
            style={{
              border: '1px solid black',
              borderRadius: '50%',
              fontSize: '50px',
              padding: '6px',
            }}
          />
        </div>
        <div>
          <p>Price</p>
          <p>55e</p>
        </div>
      </div>
      <div className='icons'>
        <div>
          <LocalOfferIcon
            style={{
              border: '1px solid black',
              borderRadius: '50%',
              fontSize: '50px',
              padding: '6px',
            }}
          />
        </div>
        <div>
          <p>Price</p>
          <p>55e</p>
        </div>
      </div>
    </div>
  );
};

export default Icon;
